export * from './utils'
export const { describe, test, it } = new Runner(
  process.env.NOBA_MAIN_ID,
  Number(process.env.NOBA_TIMEOUT) || undefined,
)
import process from 'process'
import Assert from './assert'
import Expect from './expect'
import Logger from './reporter'
import Reporter from './reporter'
import type { Func } from './types/generic'
import { race, timer, uuid } from './utils'

export type BaseCallbackParams = {
  log: InstanceType<typeof Logger>['log']
}

export type CallbackParams = {
  describe: BaseCallbackParams &
    Pick<
      InstanceType<typeof Runner>,
      | 'describe'
      | 'test'
      | 'it'
      | 'beforeEach'
      | 'afterEach'
      | 'beforeAll'
      | 'afterAll'
    >
  test: BaseCallbackParams & {
    expect: <T>(value: T) => InstanceType<typeof Expect<T>>
    assert: InstanceType<typeof Assert>
  }
}

export type HookParams = {
  beforeEach: BaseCallbackParams
  afterEach: BaseCallbackParams
  beforeAll: BaseCallbackParams
  afterAll: BaseCallbackParams
}

export type Job = {
  [K in keyof CallbackParams]: {
    type: K
    description: string
    cb: Func<CallbackParams[K], any>
  }
}[keyof CallbackParams]

export default class Runner {
  private readonly reporter: Reporter

  private jobs: Array<Job> = []
  private queued: boolean = false

  private beforeAlls: Array<{
    cb: Func<HookParams['beforeAll'], any>
    timeout?: number
  }> = []
  private afterAlls: Array<{
    cb: Func<HookParams['afterAll'], any>
    timeout?: number
  }> = []

  private beforeEachs: Array<{
    cb: Func<HookParams['beforeEach'], any>
    timeout?: number
  }> = []
  private afterEachs: Array<{
    cb: Func<HookParams['afterEach'], any>
    timeout?: number
  }> = []

  constructor(
    private readonly id: string,
    private readonly timeout: number = 5000,
    private readonly parent: Runner | null = null,
    reporter?: Reporter,
  ) {
    // This instance is created once in main and passed around
    this.reporter = reporter || new Reporter(this.id)
  }

  get isMain() {
    return this.id === process.env.NOBA_MAIN_ID
  }

  run = async () => {
    try {
      await this.runBeforeAll()
    } catch (er) {
      this.reporter.uncatch('beforeAll', er)
    }

    for (const { type, description, cb } of this.jobs) {
      if (type === 'describe') await this.runDescribe(description, cb)
      if (type === 'test') await this.runTest(description, cb)
    }

    try {
      await this.runAfterAll()
    } catch (er) {
      this.reporter.uncatch('afterAll', er)
    }
  }

  private plan = () => {
    if (!this.isMain || this.queued) return

    this.queued = true

    return queueMicrotask(async () => {
      // Setup
      const handleUncaughtException = (er: any) => {
        this.reporter.catch('Uncaught Exception', er)
      }
      const handleUnhandledRejection = (er: any) => {
        this.reporter.catch('Unhandled Rejection', er)
      }
      process.on('uncaughtException', handleUncaughtException)
      process.on('unhandledRejection', handleUnhandledRejection)
      // Run the tree of tests
      await this.run()
      // Emit the report
      this.reporter.report()
      // Teardown
      process.off('uncaughtException', handleUncaughtException)
      process.off('unhandledRejection', handleUnhandledRejection)
    })
  }

  /**
   * Describe block
   */

  describe = <T>(
    description: string,
    cb: Func<CallbackParams['describe'], T> = () => {},
  ) => {
    // Register the job
    this.jobs.push({
      type: 'describe',
      description,
      cb,
    })
    // Register the master plan
    this.plan()
  }

  private runDescribe = async <T>(
    description: string,
    cb: Func<CallbackParams['describe'], T> = () => {},
  ) => {
    this.reporter.blue(description)
    const groupEnd = this.reporter.group()

    const runner = new Runner(uuid(), this.timeout, this, this.reporter)

    try {
      await cb({
        log: runner.reporter.log,
        describe: runner.describe,
        test: runner.test,
        it: runner.it,
        beforeEach: runner.beforeEach,
        afterEach: runner.afterEach,
        beforeAll: runner.beforeAll,
        afterAll: runner.afterAll,
      })
    } catch (er) {
      this.reporter.uncatch(description, er)
    }

    await runner.run()

    groupEnd()
  }

  /**
   * Test block
   */

  test = <T>(
    description: string,
    cb: Func<CallbackParams['test'], T> = () => {},
  ) => {
    // Register the job
    this.jobs.push({
      type: 'test',
      description,
      cb,
    })
    // Register the master plan
    this.plan()
  }

  private runTest = async <T>(
    description: string,
    cb: Func<CallbackParams['test'], T> = () => {},
  ) => {
    try {
      await this.runBeforeEach()
    } catch (er) {
      this.reporter.uncatch('beforeEach', er)
    }

    const groupEnd = this.reporter.group()
    const timerEnd = timer()

    try {
      const expect = <A>(value: A) => new Expect(value, this.reporter)
      const assert = new Assert(this.reporter)

      await race(
        async () => await cb({ log: this.reporter.log, expect, assert }),
        this.timeout,
        `Cannot complete the task in ${this.timeout}ms.`,
      )

      groupEnd()
      const { message } = timerEnd()

      this.reporter.green(description, message)
      this.reporter.pass()
    } catch (er) {
      groupEnd()

      this.reporter.red(description)
      this.reporter.catch(description, er)
    }

    try {
      await this.runAfterEach()
    } catch (er) {
      this.reporter.uncatch('afterEach', er)
    }
  }

  /**
   * It block (test alias)
   */

  it = this.test

  /**
   * Before all
   */

  beforeAll = (cb?: Func<HookParams['beforeAll'], any>, timeout?: number) => {
    if (cb) this.beforeAlls.push({ cb, timeout })
  }

  private runBeforeAll = async () => {
    for (const { cb, timeout } of this.beforeAlls) {
      if (!timeout) await cb({ log: this.reporter.log })
      else
        await race(
          async () => await cb({ log: this.reporter.log }),
          timeout,
          `Cannot complete beforeAll in ${timeout}ms.`,
        )
    }
  }

  /**
   * After all
   */

  afterAll = (cb?: Func<HookParams['afterAll'], any>, timeout?: number) => {
    if (cb) this.afterAlls.push({ cb, timeout })
  }

  private runAfterAll = async () => {
    for (const { cb, timeout } of this.afterAlls) {
      if (!timeout) await cb({ log: this.reporter.log })
      else
        await race(
          async () => await cb({ log: this.reporter.log }),
          timeout,
          `Cannot complete afterAll in ${timeout}ms.`,
        )
    }
  }

  /**
   * Before each
   */

  beforeEach = (cb?: Func<HookParams['beforeEach'], any>, timeout?: number) => {
    if (cb) this.beforeEachs.push({ cb, timeout })
  }

  runBeforeEach = async () => {
    await this.parent?.runBeforeEach()
    for (const { cb, timeout } of this.beforeEachs) {
      if (!timeout) await cb({ log: this.reporter.log })
      else
        await race(
          async () => await cb({ log: this.reporter.log }),
          timeout,
          `Cannot complete afterAll in ${timeout}ms.`,
        )
    }
  }

  /**
   * After each
   */

  afterEach = (cb?: Func<HookParams['afterEach'], any>, timeout?: number) => {
    if (cb) this.afterEachs.push({ cb, timeout })
  }

  runAfterEach = async () => {
    await this.parent?.runAfterEach()
    for (const { cb, timeout } of this.afterEachs) {
      if (!timeout) await cb({ log: this.reporter.log })
      else
        await race(
          async () => await cb({ log: this.reporter.log }),
          timeout,
          `Cannot complete afterAll in ${timeout}ms.`,
        )
    }
  }
}
import Reporter from '../reporter'

export default class Assert {
  constructor(private readonly reporter: Reporter) {}

  private expect = <A, E>(actual: A, verb: string, expect: E) => {
    this.reporter.green('- Expected:', expect)
    this.reporter.red('- Received:', actual)

    return `Expect ${actual} ${verb} ${expect}.`
  }

  fail = (msg: string = 'assertion failed'): boolean => {
    throw new Error(msg)
  }

  private _isOk = <T>(value: T) => {
    return !!value
  }

  isOk = <T>(value: T, msg?: string) => {
    if (this._isOk(value)) return true
    throw new Error(msg || this.expect(value, 'to be', 'a truthy value'))
  }

  isNotOk = <T>(value: T, msg?: string) => {
    if (!this._isOk(value)) return true
    throw new Error(msg || this.expect(value, 'not to be', 'a truthy value'))
  }

  private _equal = <T>(actual: T, expected: T) => {
    return actual == expected
  }

  equal = <T>(actual: T, expected: T, msg?: string) => {
    if (this._equal(actual, expected)) return true
    throw new Error(msg || this.expect(actual, 'to equal', expected))
  }

  notEqual = <T>(actual: T, expected: T, msg?: string) => {
    if (!this._equal(actual, expected)) return true
    throw new Error(msg || this.expect(actual, 'not to equal', expected))
  }

  private _strictEqual = <T>(actual: T, expected: T) => {
    return actual === expected
  }

  strictEqual = <T>(actual: T, expected: T, msg?: string) => {
    if (this._strictEqual(actual, expected)) return true
    throw new Error(msg || this.expect(actual, 'to strictly equal', expected))
  }

  private _deepEqual = (a: any, b: any) => {
    if (a === b) return true

    if (
      typeof a !== 'object' ||
      typeof b !== 'object' ||
      a === null ||
      b === null
    )
      return false

    const keysA = Object.keys(a)
    const keysB = Object.keys(b)
    if (keysA.length !== keysB.length) return false

    for (const key of keysA)
      if (!keysB.includes(key) || !this._deepEqual(a[key], b[key])) return false

    return true
  }

  deepEqual = (a: any, b: any, msg?: string) => {
    if (this._deepEqual(a, b)) return true
    throw new Error(msg || this.expect(a, 'to deeply equal', b))
  }

  notDeepEqual = (a: any, b: any, msg?: string) => {
    if (!this._deepEqual(a, b)) return true
    throw new Error(msg || this.expect(a, 'not to deeply equal', b))
  }

  private _instanceOf = <T>(
    value: unknown,
    constructor: new (...args: any[]) => T,
  ): value is T => {
    return value instanceof constructor
  }

  instanceOf = <T>(
    value: unknown,
    constructor: new (...args: any[]) => T,
    msg?: string,
  ): value is T => {
    if (this._instanceOf(value, constructor)) return true
    throw new Error(
      msg || this.expect(value, 'to be an instance of', constructor),
    )
  }

  notInstanceOf = <T>(
    value: unknown,
    constructor: new (...args: any[]) => T,
    msg?: string,
  ) => {
    if (!this._instanceOf(value, constructor)) return true
    throw new Error(
      msg || this.expect(value, 'not to be an instance of', constructor),
    )
  }

  private _isTrue = <T>(value: T) => {
    return value === true
  }

  isTrue = <T>(value: T, msg?: string) => {
    if (this._isTrue(value)) return true
    throw new Error(msg || this.expect(value, 'to be', true))
  }

  isNotTrue = <T>(value: T, msg?: string) => {
    if (!this._isTrue(value)) return true
    throw new Error(msg || this.expect(value, 'not to be', true))
  }

  private _isFalse = <T>(value: T) => {
    return value === false
  }

  isFalse = <T>(value: T, msg?: string) => {
    if (this._isFalse(value)) return true
    throw new Error(msg || this.expect(value, 'to be', false))
  }

  isNotFalse = <T>(value: T, msg?: string) => {
    if (!this._isFalse(value)) return true
    throw new Error(msg || this.expect(value, 'not to be', false))
  }

  private _isNull = <T>(value: T) => {
    return value === null
  }

  isNull = <T>(value: T, msg?: string) => {
    if (this._isNull(value)) return true
    throw new Error(msg || this.expect(value, 'to be', null))
  }

  isNotNull = <T>(value: T, msg?: string) => {
    if (!this._isNull(value)) return true
    throw new Error(msg || this.expect(value, 'not to be', null))
  }

  private _isUndefined = <T>(value: T) => {
    return value === undefined
  }

  isUndefined = <T>(value: T, msg?: string) => {
    if (this._isUndefined(value)) return true
    throw new Error(msg || this.expect(value, 'to be', undefined))
  }

  isNotUndefined = <T>(value: T, msg?: string) => {
    if (!this._isUndefined(value)) return true
    throw new Error(msg || this.expect(value, 'not to be', undefined))
  }

  private _isNaN = <T>(value: T) => {
    return Number.isNaN(value)
  }

  isNaN = <T>(value: T, msg?: string) => {
    if (this._isNaN(value)) return true
    throw new Error(msg || this.expect(value, 'to be', NaN))
  }

  isNotNaN = <T>(value: T, msg?: string) => {
    if (!this._isNaN(value)) return true
    throw new Error(msg || this.expect(value, 'not to be', NaN))
  }

  private _isExist = <T>(value: T) => {
    return !this._isNull(value) && !this._isUndefined(value)
  }

  isExist = <T>(value: T, msg?: string) => {
    if (this._isExist(value)) return true
    throw new Error(
      msg || this.expect(value, 'not to be', 'null and undefined'),
    )
  }

  isNotExist = <T>(value: T, msg?: string) => {
    if (!this._isExist(value)) return true
    throw new Error(msg || this.expect(value, 'to be', 'null or undefined'))
  }

  private _throws = (fn: () => void, message: string | RegExp) => {
    try {
      fn()
      return false
    } catch (error: any) {
      if (!error || !error.message) return false
      if (typeof message === 'string') return error.message.includes(message)
      if (message instanceof RegExp) return message.test(error?.message)
      return false
    }
  }

  throws = (fn: () => void, message: string | RegExp, msg?: string) => {
    if (this._throws(fn, message)) return true
    throw new Error(
      msg ||
        this.expect(
          'the function',
          'to throw',
          `an error with message sastifying ${msg}`,
        ),
    )
  }

  doesNotThrow = (fn: () => void, message: string | RegExp, msg?: string) => {
    if (!this._throws(fn, message)) return true
    throw new Error(
      msg ||
        this.expect(
          'the function',
          'not to throw',
          `an error with message sastifying ${msg}`,
        ),
    )
  }

  private _rejects = async (
    fn: () => Promise<void>,
    message: string | RegExp,
  ) => {
    try {
      await fn()
      return false
    } catch (error: any) {
      if (!error || !error.message) return false
      if (typeof message === 'string') return error.message.includes(message)
      if (message instanceof RegExp) return message.test(error.message)
      return false
    }
  }

  rejects = async (
    fn: () => Promise<void>,
    message: string | RegExp,
    msg?: string,
  ) => {
    if (await this._rejects(fn, message)) return true
    throw new Error(
      msg ||
        this.expect(
          'the function',
          'to reject',
          `an error with message sastifying ${msg}`,
        ),
    )
  }

  doesNotReject = async (
    fn: () => Promise<void>,
    message: string | RegExp,
    msg?: string,
  ) => {
    if (!(await this._rejects(fn, message))) return true
    throw new Error(
      msg ||
        this.expect(
          'the function',
          'not to reject',
          `an error with message sastifying ${msg}`,
        ),
    )
  }
}
import Reporter from '../reporter'

export default class Be<A> {
  constructor(
    public readonly actual: A,
    private readonly reporter: Reporter,
    private readonly negated = false,
  ) {}

  static new = <A>(actual: A, reporter: Reporter, negated = false) => {
    const be = new this(actual, reporter, negated)
    return Object.assign(
      (...args: Parameters<InstanceType<typeof Be<A>>['be']>) => be.be(...args),
      be,
    )
  }

  get infinitive() {
    return this.negated ? 'not to be' : 'to be'
  }

  private expect = <E>(expected: E) => {
    this.reporter.green('- Expected:', expected)
    this.reporter.red('- Received:', this.actual)

    return `Expect ${this.actual} ${this.infinitive} ${expected}.`
  }

  private xor = (value: boolean) => {
    return value !== this.negated
  }

  private _be = <E extends A>(expected: E) => {
    return this.actual === expected
  }

  be = <E extends A>(expected: E) => {
    if (this.xor(this._be(expected))) return true
    throw new Error(this.expect(expected))
  }

  private _defined = () => {
    return this.actual !== undefined
  }

  defined = () => {
    if (this.xor(this._defined())) return true
    throw new Error(this.expect('defined'))
  }

  private _undefined = () => {
    return this.actual === undefined
  }

  undefined = () => {
    if (this.xor(this._undefined())) return true
    throw new Error(this.expect('undefined'))
  }

  private _truthy = () => {
    return !!this.actual
  }

  truthy = () => {
    if (this.xor(this._truthy())) return true
    throw new Error(this.expect('truthy'))
  }

  private _falsy = () => {
    return !this.actual
  }

  falsy = () => {
    if (this.xor(this._falsy())) return true
    throw new Error(this.expect('falsy'))
  }

  private _null = () => {
    return this.actual === null
  }

  null = () => {
    if (this.xor(this._null())) return true
    throw new Error(this.expect(null))
  }

  private _nan = () => {
    return Number.isNaN(this.actual)
  }

  nan = () => {
    if (this.xor(this._nan())) return true
    throw new Error(this.expect(NaN))
  }

  private _oneOf = (array: Array<A>) => {
    return array.includes(this.actual)
  }

  oneOf = (array: Array<A>) => {
    if (this.xor(this._oneOf(array))) return true
    throw new Error(this.expect(`one of ${array}`))
  }

  private _typeOf = (type: string) => {
    return typeof this.actual === type
  }

  typeOf = (type: string) => {
    if (this.xor(this._typeOf(type))) return true
    throw new Error(this.expect(`type of ${type}`))
  }

  private _instanceOf = <T>(
    constructor: new (...args: any[]) => T,
  ): this is Be<T> => {
    return this.actual instanceof constructor
  }

  instanceOf = <T>(constructor: new (...args: any[]) => T) => {
    if (this.xor(this._instanceOf(constructor))) return true
    throw new Error(this.expect(`instance of ${constructor}`))
  }
}
import Reporter from '../reporter'
import Be from './be'

export default class To<A> {
  constructor(
    public readonly actual: A,
    private readonly reporter: Reporter,
    private readonly negated = false,
  ) {}

  get infinitive() {
    return this.negated ? 'not to' : 'to'
  }

  get be() {
    return Be.new(this.actual, this.reporter, this.negated)
  }

  private expect = <E>(expected: E) => {
    this.reporter.green('- Expected:', expected)
    this.reporter.red('- Received:', this.actual)

    return `Expect ${this.actual} ${this.infinitive} ${expected}.`
  }

  private xor = (value: boolean) => {
    return value !== this.negated
  }

  private _equal = (a: any, b: any) => {
    if (a === b) return true

    if (
      typeof a !== 'object' ||
      typeof b !== 'object' ||
      a === null ||
      b === null
    )
      return false

    const keysA = Object.keys(a)
    const keysB = Object.keys(b)
    if (keysA.length !== keysB.length) return false

    for (const key of keysA)
      if (!keysB.includes(key) || !this._equal(a[key], b[key])) return false

    return true
  }

  equal = <E extends A>(expected: E) => {
    if (this.xor(this._equal(this.actual, expected))) return true
    throw new Error(this.expect(`equal to ${expected}`))
  }

  private _contain = <T>(received: T) => {
    if (typeof this.actual === 'string' && typeof received === 'string')
      return this.actual.includes(received)
    if (Array.isArray(this.actual)) return this.actual.includes(received)
    return false
  }

  contain = <T>(received: T) => {
    if (this.xor(this._contain(received))) return true
    throw new Error(this.expect(`contain ${received}`))
  }

  private _containEqual = <T>(actual: unknown, received: T) => {
    if (this._contain(received)) return true
    if (!Array.isArray(actual)) return false
    const index = actual.findIndex((a) => this._equal(a, received))
    return index >= 0
  }

  containEqual = <T>(received: T) => {
    if (this.xor(this._containEqual(this.actual, received))) return true
    throw new Error(this.expect(`contain an equal of ${received}`))
  }

  private _haveLength = (received: number) => {
    if (Array.isArray(this.actual)) return this.actual.length === received
    if (typeof this.actual === 'string') return this.actual.length === received
    return false
  }

  haveLength = (received: number) => {
    if (this.xor(this._haveLength(received))) return true
    throw new Error(this.expect(`have the length of ${received}`))
  }

  private _haveBeenCalled = () => {
    if (!this.actual) return false
    if (typeof this.actual !== 'object' && typeof this.actual !== 'function')
      return false
    if (Array.isArray(this.actual)) return false
    if ('called' in this.actual) return !!this.actual.called
    return false
  }

  haveBeenCalled = () => {
    if (this.xor(this._haveBeenCalled())) return true
    throw new Error(this.expect(`have been called`))
  }

  private _haveBeenCalledWith = (...args: any[]) => {
    if (!this.actual) return false
    if (typeof this.actual !== 'object' && typeof this.actual !== 'function')
      return false
    if (Array.isArray(this.actual)) return false
    if ('calls' in this.actual)
      return this._containEqual(this.actual.calls, args)
    return false
  }

  haveBeenCalledWith = (...args: any[]) => {
    if (this.xor(this._haveBeenCalledWith(...args))) return true
